- مستحضر طبيعي من (مكونات, ومواد) طبيعية %100 يتكون من (نبات الجينسينج البرى, وقرن الغزال, وسمك الغضروف) يعطي (قدرة, وقوة) أكبر ب (4) أضعاف القدرة العادية.

- (طبيعي, وقوي) لعلاج الضعف الشديد عند الرجال لأنه يساعد على أن تكون شخص طبيعي بدون أي آثار جانبيه (كالصداع, وزيادة تسارع نبضات القلب).

تلك التركيبة كانت تستخدم من قبل أباطرة الصين القدامي ،

حيث كان الأمبرطور مزوجا لعدد من الزوجات يبلغ من بين مائة إلي مائتين زوجة ،

يقمن معه في قصر الأمبرطور ، ويباشرهن جميعا دون كلل أو ملل.

حيث كان الأمبرطوار يعيش فوق المائة عام في المتوسط.

كانت تجمع تلك الأعشاب من منطقة التبت في الصين ،

وهي الأكثر نقاء من حيث التربة والجو النقي ، وخامات الأعشاب المتوفرة هناك.

وحين أصبح سر تلك الحبة ، لم يكن سرا بعد ، هذا ما دعي المتخصصين في طب الأعشاب في الصين

الجرعة الطبية المسموح بها:

نظرا لقوة تلك الحبوب وشدتها ، ننصح في البداية بتناول ربع حبة واحدة ،

مع بعض الطعام أو الشراب ، وقبل المجامعة بحوالي 30 دقيقة.

فإذا صارت الأمور علي مايرام ، فلتكن تلك الجرعة هي الأفضل عند البعض.

زيادة الجرعة إلي نصف حبة جائز ، أيضا مع الأكل ، وقبل المجامعة بحوالي نصف ساعة.

مفعول الدواء يستمر حوالي 72 ساعة ،

بحيث يصبح الفرد قادر علي المجامعة في أوقات قصيرة متوالية ،

خلال مدة سريان مفعول تلك الحبوب.

أما تناول حبة واحدة كاملة ،

فإنه يكون مريحا عند البعض من الرجال ،

